import React from 'react';
import './menu.css'
import { Container, Row, Col } from 'reactstrap';
import Widget from './Widgets/widget';
import Widget1 from './Widgets1/widget1';
import Widget2 from './Widgets2/widget2';
import Widget3 from './Widgets3/widget3'; 
import Widget4 from './Widgets4/widget4'; 
import Widget5 from './Widgets5/widget5'; 


const line = {
  titre: "10", 
  comment: "nouveaux albums cette semaine",

  }

const line1 = {
  titre: "LELE", 
  comment: "artiste revelation",

  }

const line2 = {
  titre: "38%", 
  comment: "d'augmentation /heure",

  }

const line3 = {
  titre: "34", 
  comment: "je sais pas quoi",

  }

  const area = {
  titre1: "Charte Area",
  comment1:"c'est une charte avec plusieurs zones",

  }

  const column = {
    titre2: "Charte en colonnes", 
    comment2: "c'est une charte avec des colonnes droites ",
  }

  const radar = {
    titre3: "Charte Radar",
    comment3: "c'est une charte qui radarise les donnees "
  }

  const rond ={

    titre4: "Charte en rond",
    comment4: "c'est une charte avec les données en rond"
  }

  const last ={

    titre5: "Charte en pie",
    comment5: "c'est une charte avec les données en pie"
  }


 class Menu extends React.Component {
  render() {
    return (        
    <div className="App">
      <Container>
          <br />
        <Row>
              <Col>
                 <Widget data={line}/>
              </Col>
              <Col>
                 <Widget data={line}/>
              </Col>
              <Col>
                 <Widget data={line}/>
              </Col>
              <Col>
                 <Widget data={line}/>
              </Col>

          </Row>

          <Row>
          <Col >
                  <Widget1 data1={area}/>
              </Col>
              <Col>
                 <Widget2 data2={column}></Widget2>
              </Col>
          </Row>

              <Row>
                 <Col>
                   <Widget3 data3={radar}/>
              </Col>
              <Col>
                 <Widget4 data4={rond}/>
              </Col>
              <Col>
                  <Widget5 data5={last}/>
              </Col>
          </Row>

        </Container>
      </div>

    );
  }
}

export default Menu;
